import Layout from "../components/Layout";

const Test = (props) => {
    const {posts} = props;
    return (
        <div>
            <Layout>
            {posts.map(post => {
                    <h1>{post}</h1>

            })};
        </Layout>

        </div>     
    );  
};

export default Test;
